import Films from "./Pages/Films/Films";
import Login from "./Pages/Login/Login";
import { Route, Routes } from "react-router-dom"


function App() {
  return (

      <div>
        <Routes>
        <Route path="/" element={<Films />} />
        <Route path="/login" element={<Login />} />
        </Routes>
      </div>
  );
}

export default App;
